import React from "react";

function Card(props) {
  function x() {
    return false;
  }

  return (
    <div
      id="pokemon-item"
      onClick={(e) => {
        {
          this.props.onClick !== "canncel"
            ? this.props.onClick([
                {
                  id: props.id,
                  name: props.name,
                  imgUrl: props.imgUrl,
                  HP: props.HP,
                  ATK: props.ATK,
                },
              ])
            : e.preventDefault();
        }
      }}
    >
      <img src={props.imgUrl} alt={props.name} />
      <p> {props.name}</p>
      <p>{`HP: ${props.HP}   ATK: ${props.ATK}`}</p>
    </div>
  );
}
export default Card;
